import React, { useEffect, useState, useRef } from 'react';
import {
    Box,
    Card,
    CardContent,
    CardActions,
    CardMedia,
    Typography,
    IconButton,
    Button,
    Stack,
    Container,
} from '@mui/material';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
import PauseIcon from '@mui/icons-material/Pause';

/**
 * Simple in-card slideshow component meant to show exported PPT slides (as images)
 * Usage:
 *  - Convert your PPT/PPTX slides to images (PNG/JPEG) and pass their URLs to `slides` prop.
 *  - Alternatively host the .pptx somewhere and use an <iframe> Office viewer (see notes below)
 */
function Slideshow({ slides = [], autoPlay = true, interval = 3000, height = 220 }) {
    const [index, setIndex] = useState(0);
    const [playing, setPlaying] = useState(autoPlay && slides.length > 1);
    const timerRef = useRef(null);

    useEffect(() => {
        if (playing && slides.length > 1) {
            timerRef.current = setInterval(() => {
                setIndex((i) => (i + 1) % slides.length);
            }, interval);
        }
        return () => clearInterval(timerRef.current);
    }, [playing, slides.length, interval]);

    useEffect(() => setIndex(0), [slides]);

    const prev = () => {
        setIndex((i) => (i - 1 + slides.length) % slides.length);
        setPlaying(false);
    };
    const next = () => {
        setIndex((i) => (i + 1) % slides.length);
        setPlaying(false);
    };

    if (!slides || slides.length === 0) {
        return (
            <Box
                sx={{ height, display: 'flex', alignItems: 'center', justifyContent: 'center', bgcolor: '#f5f5f5' }}
            >
                <Typography variant="body2" color="text.secondary">
                    No slides provided
                </Typography>
            </Box>
        );
    }

    return (
        <Box>
            <CardMedia
                component="img"
                image={slides[index]}
                alt={`slide-${index + 1}`}
                sx={{ height, objectFit: 'cover' }}
            />

            <CardActions sx={{ justifyContent: 'space-between' }}>
                <Box>
                    <IconButton onClick={prev} aria-label="previous slide">
                        <ArrowBackIosNewIcon />
                    </IconButton>
                    <IconButton onClick={next} aria-label="next slide">
                        <ArrowForwardIosIcon />
                    </IconButton>
                </Box>

                <Stack direction="row" alignItems="center" spacing={1}>
                    <Typography variant="caption">{index + 1}/{slides.length}</Typography>
                    <IconButton
                        onClick={() => setPlaying((p) => !p)}
                        aria-label={playing ? 'pause' : 'play'}
                        size="small"
                    >
                        {playing ? <PauseIcon /> : <PlayArrowIcon />}
                    </IconButton>
                </Stack>
            </CardActions>

            <Box sx={{ display: 'flex', gap: 0.5, justifyContent: 'center', p: 1 }}>
                {slides.map((_, i) => (
                    <Box
                        key={i}
                        onClick={() => { setIndex(i); setPlaying(false); }}
                        sx={{
                            width: 10,
                            height: 10,
                            borderRadius: '50%',
                            bgcolor: i === index ? 'primary.main' : 'grey.400',
                            cursor: 'pointer',
                        }}
                    />
                ))}
            </Box>
        </Box>
    );
}

/**
 * Main component: three cards each with a slideshow representing a PPT.
 * Replace the `slidesX` arrays with your actual slide-image URLs (or import them).
 */
export default function PPTCards() {
    // Example placeholder slide images — replace with your exported PPT slide images
    const slides1 = [
        'https://picsum.photos/800/450?random=101',
        'https://picsum.photos/800/450?random=102',
        'https://picsum.photos/800/450?random=103',
    ];
    const slides2 = [
        'https://picsum.photos/800/450?random=201',
        'https://picsum.photos/800/450?random=202',
    ];
    const slides3 = [
        'https://picsum.photos/800/450?random=301',
        'https://picsum.photos/800/450?random=302',
        'https://picsum.photos/800/450?random=303',
        'https://picsum.photos/800/450?random=304',
    ];

    // If you'd rather embed a hosted .pptx directly, you can use an iframe to Microsoft's viewer:
    // <iframe src={`https://view.officeapps.live.com/op/embed.aspx?src=${encodeURIComponent(PPT_URL)}`} />
    // Note: PPT_URL must be publicly accessible over HTTPS.

    return (
        <Container sx={{ py: 4 }}>
            <Typography variant="h5" sx={{ mb: 3, textAlign: 'center' }}>
                3 PPT Cards with in-card slideshow
            </Typography>

            <Stack direction={{ xs: 'column', md: 'row' }} spacing={3}>
                <Card sx={{ flex: 1 }}>
                    <Slideshow slides={slides1} autoPlay interval={2500} height={200} />
                    <CardContent>
                        <Typography variant="h6">Presentation A</Typography>
                        <Typography variant="body2" color="text.secondary">
                            Short description of presentation A. Replace slides by exporting your PPT to images.
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small" onClick={() => window.open('https://example.com/presentation-a', '_blank')}>
                            Open Hosted PPT
                        </Button>
                        <Button size="small" onClick={() => alert('Download or open local file logic')}>Download</Button>
                    </CardActions>
                </Card>

                <Card sx={{ flex: 1 }}>
                    <Slideshow slides={slides2} autoPlay interval={3000} height={200} />
                    <CardContent>
                        <Typography variant="h6">Presentation B</Typography>
                        <Typography variant="body2" color="text.secondary">
                            Short description of presentation B.
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">Open Hosted PPT</Button>
                        <Button size="small">Download</Button>
                    </CardActions>
                </Card>

                <Card sx={{ flex: 1 }}>
                    <Slideshow slides={slides3} autoPlay interval={2000} height={200} />
                    <CardContent>
                        <Typography variant="h6">Presentation C</Typography>
                        <Typography variant="body2" color="text.secondary">
                            Short description of presentation C.
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">Open Hosted PPT</Button>
                        <Button size="small">Download</Button>
                    </CardActions>
                </Card>
            </Stack>
        </Container>
    );
}
